2\":\"Kolibri is a software application that can be installed on a wide variety of devices without needing a connection to the internet.\",\"PrivacyInfoModal.kolibriAboutP3\":\"Unlike many online web services that are similarly accessed through a web browser, there are thousands of independent Kolibri installations around the world \u2013 including this one. Each Kolibri installation is managed and controlled by the owner of the device that it is installed on.\",\"PrivacyInfoModal.kolibriAboutP4\":\"It is also possible for administrators to sync Kolibri data to the cloud-based Kolibri Data Portal service. If this occurs, all facility data will be accessible to organization admins on Kolibri Data Portal. It will be uploaded to cloud servers operated by Learning Equality, who will also have access to this data.\",\"PrivacyInfoModal.kolibriAboutP5\":\"In order to improve the quality of Kolibri and the resources on it, Learning Equality collects anonymized usage information when Kolibri has access to the internet. This includes IP addresses associated with the server, and device details such as the operating system and time zone. We also collect aggregate statistics including: number of users and facilities, birth year and gender distribution, and resource popularity. We make every effort to avoid collecting personally identifying information about Kolibri users.\",\"PrivacyInfoModal.kolibriAboutTitle\":\"About Kolibri\",\"PrivacyInfoModal.kolibriOwnersP1\":\"You should run Kolibri as a service in compliance with all applicable laws. If you are the owner of the device that Kolibri is installed on, please be aware that you are ultimately responsible for the safety and protection of the user data that gets stored in Kolibri.\",\"PrivacyInfoModal.kolibriOwnersP2\":\"You should also follow best information security practices for protecting your users\u2019 data. This includes keeping the device physically secure, encrypting the hard drive, using strong and unique passwords, keeping the operating system up-to-date, and having a properly-configured firewall.\",\"PrivacyInfoModal.kolibriOwnersP3\":\"If you choose to sync your facility data to the Kolibri Data Portal, you would be granting Kolibri Data Portal organization administrators access to your data. You would also be granting access to Learning Equality, who operates the servers.\",\"PrivacyInfoModal.kolibriOwnersP4\":\"Please ensure that your users have way of getting in touch with you if they have concerns about their accounts.\",\"PrivacyInfoModal.kolibriOwnersTitle\":\"Administrators\",\"PrivacyInfoModal.kolibriUsersL1\":\"Share your password, let anyone access your account, or do anything that might put your account at risk\",\"PrivacyInfoModal.kolibriUsersL2\":\"Attempt to access any other user's account\",\"PrivacyInfoModal.kolibriUsersL3\":\"Remove, circumvent, disable, damage or otherwise interfere with security-related features of Kolibri\",\"PrivacyInfoModal.kolibriUsersL4\":\"Intentionally interfere with or damage the operation of Kolibri or any user\u2019s enjoyment of it, by any means\",\"PrivacyInfoModal.kolibriUsersP1\":\"You should use Kolibri in compliance with all applicable laws. This may mean obtaining permission from your parent, guardian, or teacher.\",\"PrivacyInfoModal.kolibriUsersP2\":\"Be aware that your personal information may be visible to others, depending on how the software has been configured and how you access the software.\",\"PrivacyInfoModal.kolibriUsersP3\":\"Please contact your local Kolibri administrator to understand what personal information of yours might be stored, who it\u2019s visible to, how to update or delete it, or if you believe your account has been compromised.\",\"PrivacyInfoModal.kolibriUsersP4\":\"You should not:\",\"PrivacyInfoModal.kolibriUsersP5\":\"When you use Kolibri as a logged-in user, information such as your name, username, age, birth year, identification number, the resources that you view, and your performance on assessments may be made available to administrators and coaches in your facility. Your information may also be used by the developers of Kolibri and shared with content creators to help improve the software and resources for different learner types and needs.\",\"PrivacyInfoModal.kolibriUsersP6\":\"When you use Kolibri as a guest, aggregate information about the resources you and other guest users view may be available to administrators and certain coaches.\",\"PrivacyInfoModal.openIdH1\":\"Signing in to third-party applications using Kolibri\",\"PrivacyInfoModal.openIdP1\":\"It is possible to use Kolibri to register or sign in to third-party applications. If you do this, the other application will have access to your Kolibri username, unique user ID, and full name.\",\"ProgressBar.pct\":\"{0, number, percent}\",\"ProgressIcon.inProgress\":\"In progress\",\"RegisterFacilityModal.enterToken\":\"Enter a project token from Kolibri Data Portal\",\"RegisterFacilityModal.invalidToken\":\"Invalid token\",\"RegisterFacilityModal.projectToken\":\"Project token\",\"RegisterFacilityModal.registerFacility\":\"Register facility\",\"ReportErrorModal.emailDescription\":\"Contact the support team with your error details and we\u2019ll do our best to help.\",\"ReportErrorModal.emailPrompt\":\"Send an email to the developers\",\"ReportErrorModal.errorDetailsHeader\":\"Error details\",\"ReportErrorModal.forumPostingTips\":\"Include a description of what you were trying to do and what you clicked on when the error appeared.\",\"ReportErrorModal.forumPrompt\":\"Visit the community forums\",\"ReportErrorModal.forumUseTips\":\"Search the community forum to see if others encountered similar issues. If unable to find anything, paste the error details below into a new forum post so we can rectify the error in a future version of Kolibri.\",\"ReportErrorModal.reportErrorHeader\":\"Report Error\",\"SearchSideBar.overCertainNumberOfSearchResults\":\"Over {num, number, integer} {num, plural, on
